INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('BACKEND', 'modules/auth/services/idp', 'de-account-is-een-beheerder-maar-heeft-geen-organisatie-in-de-acm-voeg-een-organisatie-toe-in-de-acm-no-org-linked', 'Er is een probleem met deze admin account: er is geen organisatie geregistreerd. Neem contact op met <a href="mailto:support@meemoo.be" target="">support@meemoo.be</a> en laat even weten welk e-mailadres je gebruikt om in te loggen. We brengen het zo snel mogelijk in orde.', 'TEXT', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'Er is een probleem met deze admin account: er is geen organisatie geregistreerd. Neem contact op met <a href="mailto:support@meemoo.be" target="">support@meemoo.be</a> en laat even weten welk e-mailadres je gebruikt om in te loggen. We brengen het zo snel mogelijk in orde.', value_type = 'TEXT';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('BACKEND', 'modules/auth/services/idp', 'de-account-is-een-beheerder-maar-heeft-geen-organisatie-in-de-acm-voeg-een-organisatie-toe-in-de-acm-no-org-linked', 'There''s a problem with this admin account: no organization is registered. Contact <a href="mailto:support@meemoo.be" target="">support@meemoo.be</a> and let us know which e-mail address you''re using to log in. We''ll get it sorted out as soon as possible.', 'TEXT', 'EN') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'There''s a problem with this admin account: no organization is registered. Contact <a href="mailto:support@meemoo.be" target="">support@meemoo.be</a> and let us know which e-mail address you''re using to log in. We''ll get it sorted out as soon as possible.', value_type = 'TEXT';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('BACKEND', 'modules/auth/services/idp', 'de-account-is-een-kiosk-gebruiker-maar-heeft-geen-organisatie-in-de-acm-voeg-een-organisatie-toe-in-de-acm-no-org-linked', 'Er is een probleem met deze kiosk-account: er is geen organisatie geregistreerd. Neem contact op met <a href="mailto:support@meemoo.be" target="">support@meemoo.be</a> en laat even weten welk e-mailadres je gebruikt om in te loggen. We brengen het zo snel mogelijk in orde.', 'TEXT', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'Er is een probleem met deze kiosk-account: er is geen organisatie geregistreerd. Neem contact op met <a href="mailto:support@meemoo.be" target="">support@meemoo.be</a> en laat even weten welk e-mailadres je gebruikt om in te loggen. We brengen het zo snel mogelijk in orde.', value_type = 'TEXT';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('BACKEND', 'modules/auth/services/idp', 'de-account-is-een-kiosk-gebruiker-maar-heeft-geen-organisatie-in-de-acm-voeg-een-organisatie-toe-in-de-acm-no-org-linked', 'There is a problem with this kiosk account: there is no organization registered. Contact <support@meemoo.be> and let us know which email address you use to log in. We''ll get it sorted out as soon as possible.', 'TEXT', 'EN') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'There is a problem with this kiosk account: there is no organization registered. Contact <support@meemoo.be> and let us know which email address you use to log in. We''ll get it sorted out as soon as possible.', value_type = 'TEXT';
