INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'modules/account/const/account', 'groep-cp--omschrijving', '<p>Als beheerder kan je de toegangsaanvragen voor je organisatie verwerken, heb je een overzicht van de actieve bezoekers en de materiaalaanvragen en kan je de instellingen van de bezoekertool voor jouw organisatie beheren.</p><p><a href="https://support.meemoo.be/hc/nl/articles/7060114803473" target="_blank">Lees hier meer over het beheer van de bezoekertool &gt;</a></p><p></p>', 'HTML', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Als beheerder kan je de toegangsaanvragen voor je organisatie verwerken, heb je een overzicht van de actieve bezoekers en de materiaalaanvragen en kan je de instellingen van de bezoekertool voor jouw organisatie beheren.</p><p><a href="https://support.meemoo.be/hc/nl/articles/7060114803473" target="_blank">Lees hier meer over het beheer van de bezoekertool &gt;</a></p><p></p>', value_type = 'HTML';
