INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'modules/visitor-space/components/visitor-space-search-page/visitor-space-search-page', 'pages-bezoekersruimte-zoeken-zoek-info', '<p>Je zoekresultaten voldoen aan de combinatie van alle ingegeven trefwoorden en ingestelde filters.<br/></p><p>Zoeken op een exacte woordcombinatie kan door dubbele aanhalingstekens te gebruiken.<br/></p><p>Je kan trefwoorden combineren aan de hand van AND, OR en NOT<br/></p><p><a href="https://hetarchief.be/zoeken-op-hetarchief-be" target="">Meer zoektips vind je hier &gt;</a></p>', 'HTML', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Je zoekresultaten voldoen aan de combinatie van alle ingegeven trefwoorden en ingestelde filters.<br/></p><p>Zoeken op een exacte woordcombinatie kan door dubbele aanhalingstekens te gebruiken.<br/></p><p>Je kan trefwoorden combineren aan de hand van AND, OR en NOT<br/></p><p><a href="https://hetarchief.be/zoeken-op-hetarchief-be" target="">Meer zoektips vind je hier &gt;</a></p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'modules/visitor-space/components/visitor-space-search-page/visitor-space-search-page', 'pages-bezoekersruimte-zoeken-zoek-info', 'Your search results meet the combination of all entered keywords and set filters.<br/>Search for an exact word combination by using double quotation marks.<br/>You can combine keywords according to AND, OR, and NOT<br/>More search tips you''ll find here >', 'HTML', 'EN') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'Your search results meet the combination of all entered keywords and set filters.<br/>Search for an exact word combination by using double quotation marks.<br/>You can combine keywords according to AND, OR, and NOT<br/>More search tips you''ll find here >', value_type = 'HTML';
