INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/account/mijn-profiel/index', 'alert-message', '<p>Hetarchief.be is een initiatief van meemoo. Je kan met jouw account inloggen op meerdere applicaties van meemoo. Wijzigingen aan je gegevens worden dus overal doorgevoerd.</p><p></p><p>Wil je graag je e-mailadres wijzigen? Neem dan contact op via de Feedback-knop, onderaan deze pagina.</p>', 'HTML', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Hetarchief.be is een initiatief van meemoo. Je kan met jouw account inloggen op meerdere applicaties van meemoo. Wijzigingen aan je gegevens worden dus overal doorgevoerd.</p><p></p><p>Wil je graag je e-mailadres wijzigen? Neem dan contact op via de Feedback-knop, onderaan deze pagina.</p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/account/mijn-profiel/index', 'alert-message', 'The archive.be is an initiative of meemoo. You can log in to multiple meemoo applications with your account. Changes to your data will therefore be updated everywhere.', 'HTML', 'EN') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'The archive.be is an initiative of meemoo. You can log in to multiple meemoo applications with your account. Changes to your data will therefore be updated everywhere.', value_type = 'HTML';
