INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/account/mijn-profiel/index', 'gebruikersrechten-sleutelgebruiker-omschrijving', '<p>Als sleutelgebruiker heb je niet alleen toegang tot je eigen audiovisueel archiefmateriaal, je kan ook beeld en geluid raadplegen over de grenzen van je eigen instelling en (deel)sector heen. </p><p><a href="https://support.meemoo.be/hc/nl/articles/11619550168221" target="_blank">Lees hier meer over sleutelgebruikers op hetarchief.be &gt;</a></p>', 'HTML', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Als sleutelgebruiker heb je niet alleen toegang tot je eigen audiovisueel archiefmateriaal, je kan ook beeld en geluid raadplegen over de grenzen van je eigen instelling en (deel)sector heen. </p><p><a href="https://support.meemoo.be/hc/nl/articles/11619550168221" target="_blank">Lees hier meer over sleutelgebruikers op hetarchief.be &gt;</a></p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/account/mijn-profiel/index', 'gebruikersrechten-sleutelgebruiker-omschrijving', 'As a key user, you not only have access to your own audiovisual archive material, but you can also consult images and sound across the borders of your own institution and sector.', 'HTML', 'EN') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'As a key user, you not only have access to your own audiovisual archive material, but you can also consult images and sound across the borders of your own institution and sector.', value_type = 'HTML';
