INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/account/mijn-profiel/index', 'ik-ontvang-graag-de-nieuwsbrief', '<p>Ik wil graag maximaal 3 keer per jaar een nieuwsbrief ontvangen van hetarchief.be met informatie over nieuwe mogelijkheden op het platform en inspiratie voor mijn zoektocht naar digitaal archiefmateriaal.</p><p></p><p>Ik stem in met de verwerking van mijn persoonsgegevens overeenkomstig het <a href="https://meemoo.be/nl/privacybeleid" target="_blank">privacybeleid</a>.</p>', 'HTML', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Ik wil graag maximaal 3 keer per jaar een nieuwsbrief ontvangen van hetarchief.be met informatie over nieuwe mogelijkheden op het platform en inspiratie voor mijn zoektocht naar digitaal archiefmateriaal.</p><p></p><p>Ik stem in met de verwerking van mijn persoonsgegevens overeenkomstig het <a href="https://meemoo.be/nl/privacybeleid" target="_blank">privacybeleid</a>.</p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/account/mijn-profiel/index', 'ik-ontvang-graag-de-nieuwsbrief', 'I would like to receive a newsletter from archive.be at most 3 times a year with information about new possibilities on the platform and inspiration for my search for digital archival material."
