INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/bezoekersruimte/visitor-space-slug/object-id/index', 'geen-beschrijving', '<p>Dit item beschikt nog niet over een beschrijving. Samen met onze aanbieders werken we aan de verrijking van metadata zodat de items op hetarchief.be beter doorzoekbaar worden.</p><p><a href="https://meemoo.be/nl/projecten/Filter/category:metadata" target="_blank">Lees hier meer over de initiatieven van meemoo rond metadataverrijking &gt;</a></p>', 'HTML', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Dit item beschikt nog niet over een beschrijving. Samen met onze aanbieders werken we aan de verrijking van metadata zodat de items op hetarchief.be beter doorzoekbaar worden.</p><p><a href="https://meemoo.be/nl/projecten/Filter/category:metadata" target="_blank">Lees hier meer over de initiatieven van meemoo rond metadataverrijking &gt;</a></p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/bezoekersruimte/visitor-space-slug/object-id/index', 'geen-beschrijving', 'This item does not yet have a description. Together with our providers, we are working on enriching the metadata so that the items on the archive.be become more searchable." "Read more about Meemoo''s initiatives around metadata enrichment here >', 'HTML', 'EN') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'This item does not yet have a description. Together with our providers, we are working on enriching the metadata so that the items on the archive.be become more searchable." "Read more about Meemoo''s initiatives around metadata enrichment here >', value_type = 'HTML';
