INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/cookiebeleid/index', 'cookiebeleid-seo-en-pagina-titel-seo-beschrijving', 'Deze website maakt gebruik van cookies. Net als andere websites, maken ook wij gebruik van cookies. Cookies zijn kleine tekstbestanden die op je computer worden geplaatst wanneer je onze website bezoekt. Cookies maken het correct functioneren van onze website mogelijk of meten hoe bezoekers zoals jij onze website gebruiken. Sommige cookies zijn noodzakelijk, voor anderen kan je je toestemming geven.', 'TEXT', 'NL') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'Deze website maakt gebruik van cookies. Net als andere websites, maken ook wij gebruik van cookies. Cookies zijn kleine tekstbestanden die op je computer worden geplaatst wanneer je onze website bezoekt. Cookies maken het correct functioneren van onze website mogelijk of meten hoe bezoekers zoals jij onze website gebruiken. Sommige cookies zijn noodzakelijk, voor anderen kan je je toestemming geven.', value_type = 'TEXT';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/cookiebeleid/index', 'cookiebeleid-seo-en-pagina-titel-seo-beschrijving', 'This website uses cookies. Just like other websites, we also use cookies. Cookies are small text files that are placed on your computer when you visit our website. Cookies make it possible for our website to function correctly or measure how visitors like you use our website. Some cookies are necessary, while others you can give permission for.', 'TEXT', 'EN') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'This website uses cookies. Just like other websites, we also use cookies. Cookies are small text files that are placed on your computer when you visit our website. Cookies make it possible for our website to function correctly or measure how visitors like you use our website. Some cookies are necessary, while others you can give permission for.', value_type = 'TEXT';
